import React, { useEffect, useState } from "react";
import Navbar from "./Navbar";
import axios from "axios";
import ImgCard from "./cardTemp";

export default function WishList(){
    const [data,setData]=useState([]);
    const [int1,setInt1]=useState('');
    const [int2,setInt2]=useState('');
    const [int3,setInt3]=useState('');
    const [int4,setInt4]=useState('');

    useEffect(()=>{
        fetch("http://localhost:8000/success-log",{
            method: "POST",
            headers:{
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                token:window.localStorage.getItem("token")
            })

        })
        .then((res)=>res.json())
        .then((data)=>{
            setInt1(data.data.int1);
            setInt2(data.data.int2);
            setInt3(data.data.int3);
            setInt4(data.data.int4);
        });

    })
    useEffect(()=>{
        const url = 'https://api.coingecko.com/api/v3/coins/'
        axios.get(url).then(
            (res) => { setData(res.data);
                console.log(data); }
            
        )
    },[]);
 
    const filteredCoins = data.filter(data =>
        data.name.toLowerCase().includes(int1.toLowerCase()))

    return(
        <>
        <Navbar/>
                <h3>Cryptocurrencies of your Interest</h3>
            <div className="grid-container">

                {filteredCoins.map(coin =>
                    <ImgCard
                        name={coin.name} rank={coin.market_cap_rank} price={coin.current_price}
                        marketCap={coin.market_cap} key={coin.id} url={coin.image}
                    />
                )}
            </div>
        </>
    )
}
